import React, { Component } from 'react';

class App extends Component {

    render() {
        return (
          <div id="sidebar">
            <input placeholder="search" value={this.props.query} onChange={(e) => { this.filterVenues(e.target.value) }}/>
          <br/>

          {
            this.props.filteredVenues && this.props.filteredVenues.length > 0 &&
            this.props.filteredVenues.map((venue, index) => (
              <div key={index} className="venue-item" onClick={() => { this.listItemClick(venue) }}>
              {venue.name}
              </div>
          ))
          }

          </div>
        )
}
}
